        </text>
    </g>

        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">在命令提示符中输入ping github.com，此时可以ping通github域名，发现访问速</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">度变快了</tspan>
        </text>

    <g ed:parentid="110" ed:layout="rightmap" transform="matrix(1,0,0,1,2316,1583)" ed:height="60.7" ed:width="366" id="114">

        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">二、选择TTL值最小的记录，记录下对应服务器IP地址，例</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">192.30.255.112 github.com</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">151.101.189.194 github.global.ssl.fastly.net</tspan>
        </text>
    </g>
    <g ed:parentid="110" ed:layout="rightmap" transform="matrix(1,0,0,1,2316,1650)" ed:height="60.7" ed:width="279.6" id="116">

            <tspan y="52.9" style="white-space:pre" x="8">C:\Windows\System32\drivers\etc\hosts</tspan>
        </text>
    </g>

        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">四，在文件最后添加两条信息</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">192.30.255.112 github.com</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">151.101.189.194 github.global.ssl.fastly.net</tspan>
        </text>

            <tspan y="89.7" style="white-space:pre" x="8">Linux：</tspan>

        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">ssh-keygen -t rsa -C "youremail@example.com"</tspan>
        </text>

        </text>
    </g>

            <tspan y="16.1" style="white-space:pre" x="8">然后在github的setting中找到New SSH key 按钮,title 设置标题，可以随便填，粘</tspan>

        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">假设你配置好了一个远程仓库，并且你想要提取更新的数据，你可以首先执行 git </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">fetch [alias] 告诉 Git 去获取它有你没有的数据，然后你可以执行 git merge </tspan>
            <tspan y="52.9" style="white-space:pre" x="8">[alias]/[branch] 以将服务器上的任何更新（假设有人这时候推送到服务器了）合并</tspan>
            <tspan y="71.3" style="white-space:pre" x="8">到你的当前分支。</tspan>
        </text>
    </g>

        </text>
    </g>

    <g ed:parentid="588" ed:layout="leftmap" transform="matrix(1,0,0,1,500,2093)" ed:height="37.5" ed:width="446.8" id="594">
        <path fill="none" d="M0,37.5L446.8,37.5" stroke="#696969" stroke-linejoin="round"/>
        <text class="st10">
            <tspan y="13.7" style="white-space:pre" x="8">git remote add origin2 git@github.com:tianqixin/runoob-git-test.git</tspan>
            <tspan y="29.7" style="white-space:pre" class="st8" x="8">git remote rm origin2</tspan>
        </text>
    </g>
    <g ed:parentid="519" ed:layout="leftmap" transform="matrix(1,0,0,1,1177,2551)" ed:height="23.9" ed:width="72.40000000000001" id="596">
        <path fill="none" d="M0,23.9L72.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">特别注意</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,988,2316)" ed:height="23.9" ed:width="162.8" id="598">
        <path fill="none" d="M0,23.9L162.8,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git fetch origin master</tspan>
        </text>
    </g>
    <g ed:parentid="598" ed:layout="leftmap" transform="matrix(1,0,0,1,447,2307)" ed:height="42.3" ed:width="514" id="600">
        <path fill="none" d="M0,42.3L514,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">意思是从名为 origin 的远程上拉取名为 master 的分支到本地分支 origin/master </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">中。既然是拉取代码，当然需要同时指定远程名与分支名，所以分开写</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,976,2365)" ed:height="23.9" ed:width="174" id="602">
        <path fill="none" d="M0,23.9L174,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git merge origin/master</tspan>
        </text>
    </g>
    <g ed:parentid="602" ed:layout="leftmap" transform="matrix(1,0,0,1,435,2356)" ed:height="42.3" ed:width="514" id="604">
        <path fill="none" d="M0,42.3L514,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">意思是合并名为 origin/master 的分支到当前所在分支。既然是分支的合并，当然</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">就与远程名没有直接的关系，所以没有出现远程名。需要指定的是被合并的分支。</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,989,2414)" ed:height="23.9" ed:width="161.2" id="606">
        <path fill="none" d="M0,23.9L161.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git push origin master</tspan>
        </text>
    </g>
    <g ed:parentid="606" ed:layout="leftmap" transform="matrix(1,0,0,1,448,2405)" ed:height="42.3" ed:width="514" id="608">
        <path fill="none" d="M0,42.3L514,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">意思是推送本地的 master 分支到远程 origin，涉及到远程以及分支，当然也得分</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">开写了。</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,928,2454)" ed:height="23.9" ed:width="222" id="610">
        <path fill="none" d="M0,23.9L222,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">还可以一次性拉取多个分支的代码</tspan>
        </text>
    </g>
    <g ed:parentid="610" ed:layout="leftmap" transform="matrix(1,0,0,1,631,2454)" ed:height="23.9" ed:width="270.8" id="612">
        <path fill="none" d="M0,23.9L270.8,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git fetch origin master stable oldstable</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,915,2484)" ed:height="23.9" ed:width="235.6" id="614">
        <path fill="none" d="M0,23.9L235.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">也还可以一次性合并多个分支的代码</tspan>
        </text>
    </g>
    <g ed:parentid="614" ed:layout="leftmap" transform="matrix(1,0,0,1,476,2484)" ed:height="23.9" ed:width="411.6" id="616">
        <path fill="none" d="M0,23.9L411.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git merge origin/master hotfix-2275 hotfix-2276 hotfix-2290</tspan>
        </text>
    </g>
    <g ed:parentid="198" ed:layout="leftmap" transform="matrix(1,0,0,1,1058,3116)" ed:height="23.9" ed:width="367.6" id="618">
        <path fill="none" d="M0,23.9L367.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">Git 服务器搭建（搭建一台 Git 服务器作为私有仓库使用）</tspan>
        </text>
    </g>
    <g ed:parentid="618" ed:layout="leftmap" transform="matrix(1,0,0,1,967,2844)" ed:height="23.9" ed:width="64.40000000000001" id="620">
        <path fill="none" d="M0,23.9L64.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">安装Git</tspan>
        </text>
    </g>
    <g ed:parentid="620" ed:layout="leftmap" transform="matrix(1,0,0,1,426,2826)" ed:height="60.7" ed:width="514" id="622">
        <path fill="none" d="M0,60.7L514,60.7" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ yum install curl-devel expat-devel gettext-devel openssl-devel zlib-devel </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">perl-devel</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">$ yum install git</tspan>
        </text>
    </g>
    <g ed:parentid="618" ed:layout="leftmap" transform="matrix(1,0,0,1,747,2902)" ed:height="23.9" ed:width="284.4" id="624">
        <path fill="none" d="M0,23.9L284.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">创建一个git用户组和用户，用来运行git服务</tspan>
        </text>
    </g>
    <g ed:parentid="624" ed:layout="leftmap" transform="matrix(1,0,0,1,576,2893)" ed:height="42.3" ed:width="143.6" id="626">
        <path fill="none" d="M0,42.3L143.6,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ groupadd git</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">$ useradd git -g git</tspan>
        </text>
    </g>
    <g ed:parentid="618" ed:layout="leftmap" transform="matrix(1,0,0,1,932,3021)" ed:height="23.9" ed:width="99.59999999999999" id="628">
        <path fill="none" d="M0,23.9L99.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">创建证书登录</tspan>
        </text>
    </g>
    <g ed:parentid="628" ed:layout="leftmap" transform="matrix(1,0,0,1,391,2942)" ed:height="79.09999999999999" ed:width="514" id="630">
        <path fill="none" d="M0,79.1L514,79.1" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">收集所有需要登录的用户的公钥，公钥位于id_rsa.pub文件中，把我们的公钥导入</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">到/home/git/.ssh/authorized_keys文件里，一行一个。</tspan>
            <tspan y="71.3" style="white-space:pre" x="8">如果没有该文件创建它</tspan>
        </text>
    </g>
    <g ed:parentid="628" ed:layout="leftmap" transform="matrix(1,0,0,1,664,3027)" ed:height="97.5" ed:width="241.2" id="632">
        <path fill="none" d="M0,97.5L241.2,97.5" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ cd /home/git/</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">$ mkdir .ssh</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">$ chmod 755 .ssh</tspan>
            <tspan y="71.3" style="white-space:pre" x="8">$ touch .ssh/authorized_keys</tspan>
            <tspan y="89.7" style="white-space:pre" x="8">$ chmod 644 .ssh/authorized_keys</tspan>
        </text>
    </g>
    <g ed:parentid="618" ed:layout="leftmap" transform="matrix(1,0,0,1,926,3226)" ed:height="23.9" ed:width="105.2" id="634">
        <path fill="none" d="M0,23.9L105.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">初始化Git仓库</tspan>
        </text>
    </g>
    <g ed:parentid="634" ed:layout="leftmap" transform="matrix(1,0,0,1,385,3131)" ed:height="42.3" ed:width="514" id="636">
        <path fill="none" d="M0,42.3L514,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">选定一个目录作为Git仓库，假定是/home/gitrepo/runoob.git，在/home/</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">gitrepo目录下输入命令</tspan>
        </text>
    </g>
    <g ed:parentid="634" ed:layout="leftmap" transform="matrix(1,0,0,1,483,3180)" ed:height="134.3" ed:width="416.4" id="638">
        <path fill="none" d="M0,134.3L416.4,134.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ cd /home</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">$ mkdir gitrepo</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">$ chown git:git gitrepo/</tspan>
            <tspan y="71.3" style="white-space:pre" x="8">$ cd gitrepo</tspan>
            <tspan y="108.1" style="white-space:pre" x="8">$ git init --bare runoob.git</tspan>
            <tspan y="126.5" style="white-space:pre" x="8">Initialized empty Git repository in /home/gitrepo/runoob.git/</tspan>
        </text>
    </g>
    <g ed:parentid="638" ed:layout="leftmap" transform="matrix(1,0,0,1,66,3235)" ed:height="23.9" ed:width="390" id="640">
        <path fill="none" d="M0,23.9L390,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">命令Git创建一个空仓库，服务器上的Git仓库通常都以.git结尾</tspan>
        </text>
    </g>
    <g ed:parentid="634" ed:layout="leftmap" transform="matrix(1,0,0,1,694,3321)" ed:height="23.9" ed:width="205.2" id="642">
        <path fill="none" d="M0,23.9L205.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ chown -R git:git runoob.git</tspan>
        </text>
    </g>
    <g ed:parentid="642" ed:layout="leftmap" transform="matrix(1,0,0,1,509,3321)" ed:height="23.9" ed:width="158" id="644">
        <path fill="none" d="M0,23.9L158,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">把仓库所属用户改为git</tspan>
        </text>
    </g>
    <g ed:parentid="618" ed:layout="leftmap" transform="matrix(1,0,0,1,959,3379)" ed:height="23.9" ed:width="72.40000000000001" id="646">
        <path fill="none" d="M0,23.9L72.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">克隆仓库</tspan>
        </text>
    </g>
    <g ed:parentid="646" ed:layout="leftmap" transform="matrix(1,0,0,1,543,3351)" ed:height="79.09999999999999" ed:width="389.2" id="648">
        <path fill="none" d="M0,79.1L389.2,79.1" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">$ git clone git@192.168.45.4:/home/gitrepo/runoob.git</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">Cloning into 'runoob'...</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">warning: You appear to have cloned an empty repository.</tspan>
            <tspan y="71.3" style="white-space:pre" x="8">Checking connectivity... done.</tspan>
        </text>
    </g>
    <g ed:parentid="648" ed:layout="leftmap" transform="matrix(1,0,0,1,21,3360)" ed:height="60.7" ed:width="494.8" id="650">
        <path fill="none" d="M0,60.7L494.8,60.7" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">192.168.45.4 为 Git 所在服务器 ip ，你需要将其修改为你自己的 Git 服务 ip。</tspan>
            <tspan y="52.9" style="white-space:pre" x="8">这样我们的 Git 服务器安装就完</tspan>
        </text>
    </g>
    <g ed:parentid="289" ed:layout="leftmap" transform="matrix(1,0,0,1,1138,3661)" ed:height="23.9" ed:width="207.6" id="732">
        <path fill="none" d="M0,23.9L207.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">Unstaged changes after reset</tspan>
        </text>
    </g>
    <g ed:parentid="732" ed:layout="leftmap" transform="matrix(1,0,0,1,722,3661)" ed:height="23.9" ed:width="389.2" id="734">
        <path fill="none" d="M0,23.9L389.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">没使用git命令删除文件，而是手动，而暂存区里还存在记录，</tspan>
        </text>
    </g>
    <g ed:parentid="734" ed:layout="leftmap" transform="matrix(1,0,0,1,580,3652)" ed:height="42.3" ed:width="115.6" id="736">
        <path fill="none" d="M0,42.3L115.6,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git add .</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">git reset --hard</tspan>
        </text>
    </g>
    <g ed:parentid="289" ed:layout="leftmap" transform="matrix(1,0,0,1,858,3744)" ed:height="23.9" ed:width="488.4" id="738">
        <path fill="none" d="M0,23.9L488.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">Your local changes to the following files would be overwritten by merge</tspan>
        </text>
    </g>
    <g ed:parentid="738" ed:layout="leftmap" transform="matrix(1,0,0,1,391,3710)" ed:height="23.9" ed:width="439.6" id="740">
        <path fill="none" d="M0,23.9L439.6,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">放弃本地代码，新修改的都不要了，退回上一版本，再拉取代码到本地</tspan>
        </text>
    </g>
    <g ed:parentid="740" ed:layout="leftmap" transform="matrix(1,0,0,1,209,3701)" ed:height="42.3" ed:width="154.8" id="742">
        <path fill="none" d="M0,42.3L154.8,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git reset --hard  </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">git pull origin master</tspan>
        </text>
    </g>
    <g ed:parentid="738" ed:layout="leftmap" transform="matrix(1,0,0,1,449,3768)" ed:height="23.9" ed:width="381.2" id="744">
        <path fill="none" d="M0,23.9L381.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">保留本地最新修改，并拉取仓库中忘记 pull 的代码到本地 ：</tspan>
        </text>
    </g>
    <g ed:parentid="744" ed:layout="leftmap" transform="matrix(1,0,0,1,260,3750)" ed:height="60.7" ed:width="162.8" id="746">
        <path fill="none" d="M0,60.7L162.8,60.7" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git stash  </tspan>
            <tspan y="34.5" style="white-space:pre" x="8">git pull origin master  </tspan>
            <tspan y="52.9" style="white-space:pre" x="8">git stash pop</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,1012,2533)" ed:height="23.9" ed:width="138" id="748">
        <path fill="none" d="M0,23.9L138,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">Git pull 的强制覆盖</tspan>
        </text>
    </g>
    <g ed:parentid="748" ed:layout="leftmap" transform="matrix(1,0,0,1,770,2514)" ed:height="60.7" ed:width="215.6" id="750">
        <path fill="none" d="M0,60.7L215.6,60.7" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git fetch --all</tspan>
            <tspan y="34.5" style="white-space:pre" x="8"> git reset --hard origin/master </tspan>
            <tspan y="52.9" style="white-space:pre" x="8"> git pull</tspan>
        </text>
    </g>
    <g ed:parentid="750" ed:layout="leftmap" transform="matrix(1,0,0,1,229,2524)" ed:height="42.3" ed:width="514" id="752">
        <path fill="none" d="M0,42.3L514,42.3" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">有些时候我们只想要 git 服务器中的最新版本的项目，对于本地的项目中修改不做</tspan>
            <tspan y="34.5" style="white-space:pre" x="8">任何理会，就需要用到 Git pull 的强制覆盖</tspan>
        </text>
    </g>
    <g ed:parentid="596" ed:layout="leftmap" transform="matrix(1,0,0,1,977,2688)" ed:height="23.9" ed:width="173.2" id="754">
        <path fill="none" d="M0,23.9L173.2,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git fetch和git pull的区别</tspan>
        </text>
    </g>
    <g ed:parentid="754" ed:layout="leftmap" transform="matrix(1,0,0,1,878,2658)" ed:height="23.9" ed:width="72.40000000000001" id="756">
        <path fill="none" d="M0,23.9L72.4,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">git fetch</tspan>
        </text>
    </g>
    <g ed:parentid="756" ed:layout="leftmap" transform="matrix(1,0,0,1,520,2582)" ed:height="23.9" ed:width="330.8" id="758">
        <path fill="none" d="M0,23.9L330.8,23.9" stroke="#696969" stroke-linejoin="round"/>
        <text class="st8">
            <tspan y="16.1" style="white-space:pre" x="8">相当于是从远程获取最新版本到本地，不会自动合并</tspan>
